import React from 'react';
import './app.css';
import Header from '../header/header';
import Navbar from '../nav-bar';
// import Profile from '../profile';
import Dialogs from '../dialogs';


const App = () => {
  return (
    <div className='appWrapper'> 
      <Header />
      <Navbar />
      {/* <Profile />  */}

      <div className='content'>
        <Dialogs />
      </div>

    </div>
  );
}

export default App;
